Visit Me In Baghdad (FLAC, 2003)

Come to Baghdad! Experience a city immortalized by it's rich musical culture! Join us on a musical journey presenting &quot;takasim&quot; (improvised solos), soulful rhythms, and immortal folk music.

Welcome to Baghdad, oasis of oriental splendor, jewel of the Middle East. Welcome to a city immortalized by music, literature, art, commerce, and the sciences. Welcome to this Mecca of princes and paupers, this sprawling oriental metropolis whose name alone calls to mind visions of strange and stranger fancy.

Here cupolated domes provide a brilliant mosaic of color against an azure sky. Here fabulous antiquities, modern oil pipelines, donkeys, camels and Cadillacs, form a backdrop for high living, wild parties, romance, and eerie adventures the casual western traveler hears little about. 

1. Hikayatna (Our Story)
2. Wusul Ila Baghdad (Coming to Baghdad)
3. Ta-atof (sympathy)
4. Shlonak Ayni Shlonak (How are you?)
5. Fi Al Fajr (At the sunrise)
6. Zoorooni (Visit me once a year)
7. Tallat Ya Mahla Nourha (Saw great light)
8. Tallat Min Bayt Abouha (Leaves Father's Home)
9. Shaar Al Shayeb (Whitening hair)
10. Abart Al Shat (Crossing the coast)
11. Fog El Nakhel (Above the palm tree)
12. Ya Rahib Al Dayr (Dear Priest of the Monastery)
13. Wakket Al Shukker (Thanksgiving ceremony)
14. Kanoun Baghdadi (Kanoun of Baghdad)
15. Dabke Iraqiyi (Folk Dance of Iraq)
16. Ya Sari Sarelleil (It's nighttime already?)
17. Bal Fala Jamal Sari (Camel Rider on the horizon)

